        )
    }
}






class Flogin extends Component{
    constructor(props){
        super(props)
        this.state={
            username:'djany',
            password:''
        }
this.handleUsernameChange = this.handleUsernameChange.bind(this)
    }
    
    handleUsernameChange(event){
        console.log(event);

    }
    
    
    render(){
        return(
            <div><div>
UserName:<input type="text" name="username" value={this.state.username} onChange={this.handleUsernameChange}/>
</div>
<div>
Password:<input type="password" name="password"value={this.state.password}/></div>
<button>Login</button>
</div>

        )
    }
}
export default LoginApp
